description:
Naast de goa'uld vormen ook de replicators, intelligente zelfreplicerende machines, een bedreiging. De Asgard worden bijna door hen uitgeroeid.

21.Crystal Skull - 3 maart 2000 - Nadat Daniel in een kristallen schedel heeft gekeken is hij onzichtbaar geworden.

22.Nemesis - deel 1 - 10 maart 2000 - De Asgard Thor brengt zijn schip naar de aarde en vraagt O'Neill om hulp tegen een ras waar zij niet tegen opgewassen zijn.
